    data: |
      SELECT ALL col2 + - 76 FROM tab1 (FORMAT parquet) AS cor0 WHERE - - col1 * + CAST ( NULL AS INTEGER ) IS NOT NULL AND col0 * 66 >= ( + col2 );
  - name: tab1

outputs:
  - name: q5467.out
    data: |
